const Projects = () => (
  <div className="main">
    <div>
      <h1>Selected Projects.</h1>
    </div>
    <div className="projects--cards">
      <div className="card_img"></div>
      <div className="card_description"></div>
    </div>
    <div className="projects--cards">
      <div className="card_img"></div>
      <div className="card_description"></div>
    </div>
    <div className="projects--cards">
      <div className="card_img"></div>
      <div className="card_description"></div>
    </div>
    <style jsx>
      {`
        .main {
          display: flex;
          text-align: center;
          flex-direction: column;
          margin: 0 115.5px;
        }
        h1 {
          text-align: left;
          font-family: Montserrat;
          font-size: 45px;
        }
        .projects--cards {
          display: flex;
          padding: 25px 120px;
        }
        .card_img {
          display: flex;
          height: 300px;
          width: 50%;
          border: 1px solid;
        }
        .card_description {
          display: flex;
          height: 300px;
          width: 50%;
          box-shadow: 5px 5px 10px #999;
        }
      `}
    </style>
  </div>
);

export default Projects;
